import './App.css';

function App() {
  return (

    <div className="App">
      <header className="App-header">
        <i className="fas fa-pizza-slice"></i>
        <h1>Eman's Food Reviews</h1>
        <input
          id="search"
          type="text"
          name="search"
          placeholder="Search Restaurants ..."
          >
        </input>
      </header>
    </div>

  );
}

export default App;
